import React from 'react'
import DH from '../assets/dh.png'
import {ContextGlobal} from './utils/global.context'


const Footer = () => {
  return (
    <footer>
        <p>Powered by</p>
        <img src="./img/DH.png" alt='DH-logo' />
        <p>Mercedes Bakker - CAMADA 4 all rights reserved</p>
    </footer>
  )
}

export default Footer
